class AddressModel {  String? status;  List<Data>? data;  AddressModel({this.status, this.data});  AddressModel.fromJson(Map<String, dynamic> json) {    status = json['status'];    if (json['data'] != null) {      data = <Data>[];      json['data'].forEach((v) {        data!.add(new Data.fromJson(v));      });    }  }}class Data {  String? addressId;  String? addressName;  String? addressUserid;  String? addressCity;  String? addressStreet;  String? addressLat;  String? addressLong;  Data(      {this.addressId,        this.addressName,        this.addressUserid,        this.addressCity,        this.addressStreet,        this.addressLat,        this.addressLong});  Data.fromJson(Map<String, dynamic> json) {    addressId = json['address_id'];    addressName = json['address_name'];    addressUserid = json['address_userid'];    addressCity = json['address_city'];    addressStreet = json['address_street'];    addressLat = json['address_lat'];    addressLong = json['address_long'];  }}